import React, { Component } from 'react';

class Header extends Component {
  render() {
    return (
      <header>
        <div className="logo-container">
          <span className="logo-icon"> <i class="fab fa-github"></i> </span>
        </div>
      </header>
    );
  }
}

export default Header;
